import { useNavigate } from "react-router-dom"; // Import useNavigate

function Table() {
  const navigate = useNavigate(); // Initialize navigate

  return (
    <tbody className="text-gray-600 text-sm font-light">
      {tableData.length > 0 ? (
        tableData.map((patient, index) => (
          <tr
            key={index}
            className="border-b border-gray-200 hover:bg-gray-100"
          >
            <td className="py-3 px-6 text-left whitespace-nowrap">
              <span className="font-medium">{patient.name}</span>
            </td>
            <td className="py-3 px-6 text-left">{patient.phoneNumber}</td>
            <td className="py-3 px-6 text-left">{patient.blood}</td>
            <td className="py-3 px-6 text-center">
              {patient.profileImage ? (
                <img
                  src={`http://localhost:4600${patient.profileImage}`}
                  alt="Profile"
                  className="w-12 h-12 rounded-full object-cover"
                />
              ) : (
                "No Image"
              )}
            </td>
            <td className="py-3 px-6 text-center">
              <button
                onClick={() => navigate(`/patient-detail/${patient.id}`)}
                className="bg-blue-500 text-white px-3 py-1 rounded text-sm"
              >
                View Details
              </button>
            </td>
          </tr>
        ))
      ) : (
        <tr>
          <td colSpan="5" className="text-center py-4">
            No Data Available
          </td>
        </tr>
      )}
    </tbody>
  );
}

export default Table;
